import React from "react";
import "./left-scroll.css"

class LeftScroll extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0
        }
        this.elems = [
            'Уровень',
            'Раса',
            'Класс',
            'Характеристики',
            'Черты',
            'Предыстория',
            'Ваш персонаж',
        ]
    }

    render() {
        return (
            <div className="left-scroll-div">
                <ul>
                    {
                        this.elems.map((item)=>{
                            <li className="left-scroll-li">{item.text}</li>
                        })
                    }
                </ul>
            </div>
        );
    }
}

export default LeftScroll
